import React from 'react';
import styles from './Feed.module.css';
import Link from 'next/link';
import Router from 'next/router'


function FeedHeader({filter, setPosts}) {
  return (
    <div className={styles.feed_header}>
      {filter == 'tags' ?  
    <div>Feed filtered by tag. <div onClick={setPosts}>Reset the feed.</div></div>
    :    
    <div>Your search results. <div onClick={() => setPosts}>Reset the feed.</div></div>
    }

    </div>
  );
}

export default FeedHeader;
